import React from 'react'
import Video from '../../Asset/React Router Beginners-4.mp4'
import Test from '../../Asset/intro-to-react-router.jpeg';
import '../../Component/MainVideo/MainVideo.scss';
import YouTube from 'react-youtube';

function MainVideo() {
    return (
        <div className='main'>
           <iframe  width="560" height="315" src="https://www.youtube.com/embed/-dS9pvGqlX8" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
    )
}

export default MainVideo
